def plot_avg_platoon_time_graph():
    data = [[8111.32120833/60, 6062.16710393/60],[8209.18331296/60,6103.92309649/60],[7340.79646793/60,5125.55125434/60],[4811.30066905/60,2068.8262203/60]]
    pos = list(range(len(data)))
    width = 0.25
    fig, ax = plt.subplots(figsize=(10, 5))

    plt.bar(pos, [x[0] for x in data], width, label="All trucks")
    plt.bar([x+width for x in pos], [x[1] for x in data], width, label="Platooning trucks")
    plt.legend(['All trucks', "Platooning trucks"])
    # Set the position of the x ticks
    ax.set_xticks([p + 0.5 * width for p in pos])

    # Set the labels for the x ticks
    ax.set_xticklabels(["Greedy","Random","Deterministic\nUSM","Randomized\nUSM"])
    plt.ylabel("Average active plan time (minutes)")
    plt.show()


